import React from "react";
import { Box, Typography } from "@material-ui/core";
import pepsico from "../../assets/pepsico.png";
import airtable from "../../assets/airtable.png";
import dunkin from "../../assets/dunkin.png";
import hubspot from "../../assets/hubspot.png";
import zapier from "../../assets/zapier.png";

const Brands = () => {
  return (
    <Box>
      <Box>
        <Typography>Brands with us</Typography>
      </Box>
      <Box>
        <img src={pepsico} alt="pepsico logo" />
        <img src={dunkin} alt="pepsico logo" />
        <img src={zapier} alt="pepsico logo" />
        <img src={airtable} alt="pepsico logo" />
        <img src={hubspot} alt="pepsico logo" />
      </Box>
    </Box>
  );
};

export default Brands;
